const Header = () => {
    return (
        <div className="w-full bg-[#020234] text-white">
            <div className="w-full px-8 py-4 ml-16">
                <div>
                    <img
                        src="/assets/logos/nipun_logo.png"
                        alt="Logo"
                        className="w-20 h-20 rounded-full object-cover shrink-0"
                    />
                </div>
            </div>
        </div>
    )
}

export default Header;
